import './App.css';
import { useState } from 'react';

function Lesson() {
    const [value1, setValue1] = useState("12-12-2012");
    const [value2, setValue2] = useState("01-12-2012");
    const [result, setResult] = useState("");
  
  
  
      return <div>
        <input type='text' value={value1} onChange={(event) => setValue1(event.target.value)}></input>
        <input type='text' value={value2} onChange={(event) => setValue2(event.target.value)}></input>
  
        <button onClick={()=> setResult(Number(value1.slice(0,2))-Number(value2.slice(0,2)))}>узнать разницу</button>
         <p>{result}</p>
  
      </div>;
    }

  export default Lesson;
